import React, { Component } from 'react';

import ChangeProfile from './ChangeProfile';

import './Header.css';

class Header extends Component {

    render () {
        return (
            <div className='Header'>
                <div className="left-box">
                    TIMELINE
                </div>
                <div className="right-box">
                    <ChangeProfile/> 오른쪽
                </div>
            </div>
        );
    }
}

export default Header;
